import { Row, Col } from 'antd';
import style from 'menu.module.css';

const Menu = () => {
return (
<>
<Row gutter={16}>
<Col md={20} xs={6}> 
<div className={style.menuItem}>
Citizens
</div>

</Col>
</Row>           
</>
);
};

export default Menu;
